  "text" : "\uAD6D\uAC00\uC758 \uC815\uCC45\uACFC \uC0AC\uD68C\uC758 \uD65C\uB3D9\uC740 \uC5B4\uB5BB\uAC8C \uACC4\uCE35\uAC04 \uC774\uB3D9\uC131\uC744 \uB192\uC774\uACE0 \uC5B4\uB5A4 \uACC4\uCE35\uC774\uB4E0 '\uAE30\uD68C\uC758 \uADE0\uB4F1'\uACFC '\uD328\uC790\uBD80\uD65C\uC804'\uC744 \uB178\uB9B4 \uC218 \uC788\uB3C4\uB85D \uD560 \uC218 \uC788\uC744\uAE4C?\n\uB3C8\uC744 \uC900\uB2E4\uAC70\uB098 \uBC14\uC6B0\uCC98\uB97C \uC900\uB2E4\uACE0 \uB05D\uC774 \uC544\uB2C8\uB2E4. \uC624\uD788\uB824 \uB05D\uC5C6\uC774 \uC0AC\uB78C\uB4E4\uC744 \uB3CC\uBCFC \uC218 \uC788\uB294 \uBD80\uC9C0\uB7F0\uD568\uACFC \uC608\uBBFC\uD568\uC774 \uD544\uC694\uD558\uB2E4.",
